import "./SidePanel.css";

function SidePanel({children}) {

    return (
        <div className="side-panel">
            <div className='image-wrapper'>
                <div className='image'>
                    <span>IHC</span>
                </div>
                <span className='name'>Interação Humano Computador</span>
            </div>
            {children}
        </div>
    )
}

export default SidePanel;
